import React from 'react';
import css from './header.module.css';

const header = () =>{
    return(
    <>
    <h3>Devices</h3>
    <select>
        <option>aaa</option>
        <option>bbb</option>
        <option>ccc</option>
    </select>
    <button id={css.more-btn} className={css.more-btn}>
            <span className={css.more-dot}></span>
            <span className={css.more-dot}></span>
            <span className={css.more-dot}></span>
        </button>
    </>)
}

export default header;
